import React from "react";
import { BrowserRouter as Router, Routes, Link, Switch } from 'react-router-dom'
import Home from "./components/Homepage"

const App = () => {
    return (
        <Router>
            <Routes path="/">
                <Home />
            </Routes>
        </Router>
    )
}

export default App
